import React from 'react';
import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
    },
    boxContainer: {
        backgroundColor: 'grey',
        marginTop: 50
    }
});

export default styles;
